import React from 'react';
import '../../App.css';
import Footer from '../Footer'


export default function SignUp() {
  return (
    <>
      <h1 className='sign-up'>SIGN-UP</h1>
      <p>To sign-up enter your desired username and password combination</p>
      <Footer/>
    </>
    );
}
